DROP TABLE IF EXISTS CS130_2017_Lab7_Property;

create table CS130_2017_Lab7_Property (
	id INT NOT NULL,
	agent TEXT ,
	address TEXT,
	numbeds INT,
	askingprice INT,
	housetype TEXT,
	energyRating VARCHAR(2),
	listingdate DATE,
	CONSTRAINT CS130_2017_Lab7_Property_Pkey PRIMARY KEY(id)
);

SELECT * FROM CS130_2017_Lab7_Property;

UPDATE CS130_2017_Lab7_Property SET listingdate = '2017-10-15' WHERE listingdate = '2017-10-13' OR listingdate = '2017-10-14';

UPDATE CS130_2017_Lab7_Property SET askingprice = 100000 WHERE askingprice >95000 AND askingprice <100000;

DELETE FROM CS130_2017_Lab7_Property WHERE agent = 'Property Kings' AND housetype = 'Semi-detached' AND (energyrating = 'C' OR energyrating = 'D');

DELETE FROM CS130_2017_Lab7_Property WHERE (agent IS NULL) OR (numbeds IS NULL);

UPDATE CS130_2017_Lab7_Property SET askingprice = (askingprice/100 * 92) WHERE agent = 'CS130 Estates';

DELETE FROM CS130_2017_Lab7_Property WHERE char_length(address) > 20 AND address ~ '^.*\d{4,}.*$' AND address ~* '^.*road$';